def validation (input):
    temp = []
    print(len(input))
    if len(input)%2 != 0:
        return False
    for elem in input:
        if elem in "{([":
            temp.append(elem)
            input = input[1:] 
        elif elem in "}])":
            # print(temp)   
            if len(temp) == 0:
                return False
            el = temp.pop()
            if (elem == ")" and el == "(" or elem == "}" and
                el == "{" or elem == "]" and el == "[") == False:
               return False 
            else:
                input = input[1:]
        else: 
            return False
    return True

